import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  containerConfig: {
    backgroundColor:"#FFF2D8"
  },
  navConfig:{
    backgroundColor:'#d5ecb4'
  },
  inputConfig:{
    backgroundColor:'white',
    width:'200px',
    alignItens:'center'

  },
  buttonConfig1:{
    backgroundcolor:'#d5ecb4',
    alignItens:'center'
  },
  buttonConfig2:{
    backgroundColor:'red',
    alignItens:'center'
  },
  buttonConfig3:{
    backgroundColor:'F1C4A5',
    alignItens:'center'
  }
});
